import React from 'react';
import { Image, View, Text } from 'react-native';

export default function App() {
  return (
    <View style={{
      backgroundColor: "#fff",
      flex: 1,
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'stretch',
    }}>
      <View style={{
        backgroundColor: 'dodgerblue',
        width: '100%',
        flex: 8,
        justifyContent:"flex-start",
        alignItems: "center"
      }}>
        <View style={{
          position: "absolute", 
          top:70,
          alignItems: "center" }}>
        <Image style={{width:100, height:100, }} source={require('./assets/logo_ct_rondnoir_blanc.png')}/>
        <Text fontSize={12}>Set what You Don't Need</Text>
        </View>
      </View>
      <View style={{
        backgroundColor: 'tomato',
        width: '100%',
        flex:1,
      }}/>
      <View style={{
        backgroundColor: 'rgb(64, 224, 208)',
        width: '100%',
        flex:1,
      }}/>
    </View>
  ); 
}
